	},
	{
		name: 'Firebase',
		icon: firebase,
	},
	{
		name: 'Adobe Illustrator',
		icon: illustrator,
	},
	{
		name: 'Adobe After Effects',
		icon: aftereffects,
	},
	{
		name: 'Git',
		icon: git,
	},
	{
		name: 'Rhino',
		icon: rhino,
	},
	{
		name: 'Python',
		icon: python,
	},
	{
		name: 'C++',
		icon: cpp,
	},
	{
		name: 'Java',
		icon: java,
	},
];

export { specialWorks, technologies };
